import axios from 'axios';

const baseURI = 'http://127.0.0.1:8000/api/auth/';
function postData(serviceProvider, userData) {
  axios
    .post(baseURI + serviceProvider, userData)
    .then((res) => {
      res.data['user'];
    })
    .catch((error) => {
      console.log(error.message);
    });
}
export default postData;
